%[text] ## Set Path and Load file
clearvars
close all
paths.folder = "/Users/ernesto/Downloads/Totalsegmentator_dataset_v201"; %[control:filebrowser:952e]{"position":[16,72]}
paths.volName = "ct.nii.gz";
T = readtable(fullfile(paths.folder,"meta.csv"));
T = convertvars(T,["image_id","study_type"],"string");
%%
%[text] ### Sort Table by study type
T = sortrows(T,"study_type") %[output:57a377c3]
%%
%[text] ### Create a subtable that contains just the study type you want to explore
studyType = unique(T.study_type);
selectedType = studyType(33) %[control:dropdown:4752]{"position":[16,29]} %[output:73b83554]
la = T.study_type == selectedType;
t = T(la,:) % create subtable %[output:7edadb8e]
%%
%[text] ### Display the CT Volume
t_row = 4; % row in subtable %[control:spinner:1943]{"position":[9,10]}

mv = medicalVolume(fullfile(paths.folder,t.image_id(t_row),paths.volName));
hvs = volshow(mv,RenderingStyle="GradientOpacity");
hvs.Parent.Title=t.image_id{t_row}; %[output:68d60614]
%%
%[text] #### adjust the alphamap
hvs.Alphamap = single(linspace(0,.5,256)); % adjust intensity alpha values - not the low values
%[text] 
%%
%[text] ### Explore the segmentations
%[text] What segmentations can be found in the selected folder? (volume shown above)
segContents = dir(fullfile(paths.folder,t.image_id{t_row},"segmentations","*.nii.gz")) %[output:531462e5]
%%
seg_idx = 3; % index in segContents
segMV = medicalVolume(fullfile(contents(seg_idx).folder,contents(seg_idx).name));
volshow(segMV) %[output:487aac40]
%[text] if empty, likely the segmentation is empty
%%
%[text] ### Search for a segmentation
sum(contains({segContents.name},'hip')) %[output:84a8e3fb]

